import React from 'react';
import './SearchBar.css';

const SearchBar = () => {
  return (
    <div className="input-group">
      <input
        type="search"
        className="form-control rounded"
        placeholder="Search"
        aria-label="Search"
        aria-describedby="search-addon"
      />
      <button
        type="button"
        className="btn btn-outline-primary"
      >
        Search Medicine
      </button>
    </div>
  );
};

export default SearchBar;
